import axios from 'axios';

const BASE_URL = 'http://192.168.1.3:8000/api';  // Ajusta esta IP a la de tu PC

const api = axios.create({
  baseURL: BASE_URL,
  headers: {
    'Content-Type': 'application/json',
    Accept: 'application/json',
  },
});

export default api;
